import React, { Component } from 'react';

class Timeslots extends Component {
  render() {
    const text = 'Hi';
    return (

    <Grid>
      <Row className="show-grid">
        <Col xs={6} md={4}>
          {text}
        </Col>
        <Col xs={6} md={4}>
         {text}
        </Col>
        <Col xs={6} md={4}>
          {text}
        </Col>
      </Row>
    </Grid>
    );
  }
}

export default Timeslots;
